class SessionStorage{static save(options={}){try{if(typeof options.name==='undefined'||options.name.length<1){console.warn('Faile no name');return!1}
sessionStorage.setItem(options.name,options.value);return!0}
catch(e){return!1}}
static read(name){try{if(name.length<1){console.warn('Faile no name');return!1}
var out=sessionStorage.getItem(name);return out}
catch(e){return!1}}
static remove(name=''){try{if(typeof name==='undefined'||name.length<1){console.warn('Faile no name');return!1}
sessionStorage.removeItem(name);return!0}
catch(e){return!1}}
static storageAvailable(){try{var storage=window.sessionStorage,x='__storage_test__';storage.setItem(x,x);storage.removeItem(x);return!0}
catch(e){return e instanceof DOMException&&(e.code===22||e.code===1014||e.name==='QuotaExceededError'||e.name==='NS_ERROR_DOM_QUOTA_REACHED')&&storage.length!==0}}}
class CookieStorage{static save(options={}){try{var send="";if(typeof options.name==='undefined'||options.name.length<1){console.warn('Faile no name');return!1}
send+=options.name;if(options.noEncode===!0){send+="="+options.value}else{send+="="+encodeURIComponent(options.value)}
if(options.days&&options.days>1){var d=new Date();d.setTime(d.getTime()+(options.days*24*60*60*1000));send+=";expires="+d.toUTCString()}
if(options.path&&1<=options.path.length){send+=";path=/"+options.path}
document.cookie=send;return!0}
catch(e){return!1}}
static remove(options={}){try{if(typeof options.name==='undefined'||options.name.length<1){console.warn('Faile no name');return!1}
var send=options.name+"="+""+";expires=Thu, 01 Jan 1970 00:00:01 GMT;";if(options.path&&1<=options.path.length){send+=";path=/"+options.path}
document.cookie=send;return!0}
catch(e){return!1}}
static read(name='',noDecode=!1){try{if(typeof name==='undefined'||name.length<1){console.warn('Faile no name');return!1}
name=name+"=";if(!noDecode){var cookieData=decodeURIComponent(document.cookie)}else{var cookieData=document.cookie}
var ca=cookieData.split(';');for(var i=0;i<ca.length;i++){var c=ca[i];while(c.charAt(0)==' '){c=c.substring(1)}
if(c.indexOf(name)==0){var value=c.substring(name.length,c.length);return value}}
console.warn('Not found');return''}
catch(e){return!1}}
static storageAvailable(){let r=this.ifEnabled();return r}
static ifEnabled(){try{this.save({name:"IfEnabledCookie_test",value:"test",days:2});var cookie=this.read("IfEnabledCookie_test");if(cookie){this.remove({name:"IfEnabledCookie_test"});return!0}else{this.remove({name:"IfEnabledCookie_test"});console.warn('NotEnabled');return!1}}
catch(e){return!1}}}
class KeyHelper{static keyRead(name){let value=!1;if(typeof SessionStorage!='undefined'&&SessionStorage.storageAvailable()){value=SessionStorage.read(name)}else if(typeof CookieStorage!='undefined'&&CookieStorage.storageAvailable()){value=CookieStorage.read(name)}else{console.warn('There is no storage to use')}
return value}
static keySave(options={}){let value=!1;if(typeof SessionStorage!='undefined'&&SessionStorage.storageAvailable()){value=SessionStorage.save(options)}else if(typeof CookieStorage!='undefined'&&CookieStorage.storageAvailable()){value=CookieStorage.save(options)}else{console.warn('There is no storage to use')}
return value}
static keyRemove(name){let value=!1;if(typeof SessionStorage!='undefined'&&SessionStorage.storageAvailable()){value=SessionStorage.remove(name)}else if(typeof CookieStorage!='undefined'&&CookieStorage.storageAvailable()){value=CookieStorage.remove(name)}else{console.warn('There is no storage to use')}
return value}}